import Inicio from "./paginas/Inicio";

function App() {
  return (<>

    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Inicio/>}/>
        <Route path="/sobremim" element=<h1>sobre mim</h1>/>
        <Route path="*" element=<h1> 404 - Página não encontrada!</h1>/>


      </Routes>
    </BrowserRouter>
  </>
  );
}

export default App;
